import {
  Button,
  Card,
  CardBody,
  CardHeader,
  Col,
  Container,
  Form,
  FormFeedback,
  FormGroup,
  Input,
  Label,
  Row,
} from "reactstrap";
import { NavLink as ReactLink, useNavigate } from "react-router-dom";
import Base from "../components/Base";
const Signup = () => {
  return (
    //<Base>
      <Container>
          <a href="/"><h1 className="text-warning text-center">MyBlog</h1></a>
        <Card>
          <CardHeader>
            <h3>Create a new account</h3>It's quick and easy.
          </CardHeader>

          <CardBody>
            {/* creating registerbody */}
            <Form>
              {/* namefild */}
              <FormGroup>
                <Input type="text" placeholder="Name" id="name" />
              </FormGroup>

              {/* Emailfild */}
              <FormGroup>
                <Input type="email" placeholder="email address" id="email" />
              </FormGroup>

              {/* Passwordfild */}
              <FormGroup>
                <Input type="password" placeholder="New Password" id="pass" />
              </FormGroup>

              {/* about field */}
              <FormGroup>
                <Label for="about">Write something about yourself</Label>
                <Input
                  type="textarea"
                  placeholder="Enter here"
                  id="about"
                  style={{ height: "250px" }}
                />

              </FormGroup>
            </Form>
          </CardBody>
        </Card>
      </Container>
    //</Base>
  );
};

export default Signup;
